import React from 'react';

const About = () => {
  return (
    <div>
      <h2>Estudiantes</h2>
      <p>
      Daniela Madrigal Morales
      </p>
      <p>
        Jennifer Lobo Vasquez
      </p>
      <p>
        Diego Quiros
        Jorge Duran
      </p>
    </div>
  );
};

export default About;
